// src/components/Navbar.js
import React, { useMemo, useState } from "react";
import { Link, NavLink } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const IconBtn = ({ to, title, children }) => (
  <NavLink
    to={to}
    title={title}
    className={({ isActive }) =>
      `icon-btn ${isActive ? "active" : ""}`
    }
  >
    {children}
  </NavLink>
);

const Navbar = () => {
  const { user, logout } = useAuth();
  const [openMore, setOpenMore] = useState(false);

  const role = user?.role;

  const leftLinks = useMemo(() => {
    // always visible primary links
    const base = [
      { to: "/", label: "Home", auth: true },
      { to: "/crops", label: "Crops", auth: true },
      { to: "/education", label: "Education", auth: true },
      { to: "/complaints", label: "Complaints", auth: true },
      { to: "/search", label: "Search", auth: true },
    ];

    // add subsidiy main link (optional for all)
    base.push({ to: "/subsidies", label: "Subsidies", auth: true });

    return base;
  }, []);

  const moreLinks = useMemo(() => {
    // put "extra" links here so navbar stays clean
    const links = [];

    // admin tools
    if (role === "ADMIN") {
      links.push({ to: "/admin", label: "Admin Panel" });
      links.push({ to: "/analytics", label: "Analytics" });
      links.push({ to: "/verification", label: "Verification" });
      links.push({ to: "/ledger", label: "Ledger" });
      links.push({ to: "/crops/admin/add", label: "Add Crop" });
    }

    // gov tools
    if (role === "GOV_OFFICIAL") {
      links.push({ to: "/verification", label: "Verification" });
      links.push({ to: "/ledger", label: "Ledger" });
    }

    return links;
  }, [role]);

  return (
    <header className="navbar">
      <div className="navbar-inner">
        {/* Brand */}
        <div className="nav-left">
          <div className="brand">
            <div className="brand-badge" />
            <Link to="/" className="brand-name">AgroTrust</Link>
          </div>

          {/* Primary Links */}
          {user && (
            <nav className="nav-links" onClick={() => setOpenMore(false)}>
              {leftLinks
                .filter((l) => (l.auth ? !!user : true))
                .map((l) => (
                  <NavLink
                    key={l.to}
                    to={l.to}
                    className={({ isActive }) =>
                      `nav-link ${isActive ? "active" : ""}`
                    }
                  >
                    {l.label}
                  </NavLink>
                ))}

              {/* More dropdown (only if needed) */}
              {moreLinks.length > 0 && (
                <div className="more-wrap">
                  <button
                    type="button"
                    className={`nav-link more-btn ${openMore ? "active" : ""}`}
                    onClick={() => setOpenMore((v) => !v)}
                  >
                    More â–¾
                  </button>

                  {openMore && (
                    <div className="more-menu" onMouseLeave={() => setOpenMore(false)}>
                      {moreLinks.map((l) => (
                        <NavLink
                          key={l.to}
                          to={l.to}
                          className={({ isActive }) =>
                            `more-item ${isActive ? "active" : ""}`
                          }
                          onClick={() => setOpenMore(false)}
                        >
                          {l.label}
                        </NavLink>
                      ))}
                    </div>
                  )}
                </div>
              )}
            </nav>
          )}
        </div>

        {/* Right side */}
        <div className="nav-right">
          {user ? (
            <>
              {/* Icon shortcuts */}
              <div className="icon-row">
                <IconBtn to="/notifications" title="Notifications">ðŸ””</IconBtn>
                <IconBtn to="/chatbot" title="Chatbot">ðŸ’¬</IconBtn>
              </div>

              <span className="pill">
                {user.name} ({user.role})
              </span>

              <button className="btn btn-danger" onClick={logout}>
                Logout
              </button>
            </>
          ) : (
            <div className="auth-row">
              <Link className="btn" to="/login">Login</Link>
              <Link className="btn btn-primary" to="/register">Register</Link>
            </div>
          )}
        </div>
      </div>
    </header>
  );
};

export default Navbar;
